INSERT INTO `pe_article` VALUES('1','关于简好科技','<p>\r\n	灵宝简好网络科技有限公司，优秀的互联网平台与服务提供商，六年网站设计与开发经验，专业从事互联网软件开发等网络技术服务。自公司成立以来，简好科技始终秉承“产品简单好用，用心服务客户”的核心经营理念，在自主研发的创新之路稳健前行。&nbsp;\r\n</p>\r\n<p>\r\n	<br />\r\n严谨的程序开发人员、专业的美工设计、良好的服务让我们在竞争激烈的互联网行业中蓬勃发展。通过我们多年在上百个不同行业领域的项目历练，加之对\r\n各行业、各类型客户需求的理解，抛开炒作与虚夸，以一贯低调、踏实、诚信的风格为企、事业单位提供更好更实用的一站式网站建设服务！\r\n</p>\r\n<p>\r\n	<br />\r\n简好科技坚信质量和信誉是我们存在的基石。我们注重客户提出的每个要求并充分考虑每一个细节，积极做好服务，不断地完善自己，通过不懈的努力，我们把每一\r\n位客户都做成了朋友，感谢你们对简好科技的信任与支持，这种信任与支持激励着我们提供更优质的服务。在所有新老客户面前，我们都很乐意朴实的跟您接触，深\r\n入的了解您的企业，每一次倾心的合作，都是一个全新的体会和挑战，我们随时与您同在。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	详情请访问：<a href=\"http://www.phpshe.com\" target=\"_blank\"><strong><span style=\"color:#E53333;\">简好科技官方网站</span></strong></a> \r\n</p>','1335834720','990','1'),
('2','PHPSHE B2C商城系统v1.2版发布','<a target=\"_blank\" href=\"http://www.phpshe.com/phpshe\"><span style=\"color:#E53333;\"><strong>PHPSHE商城系统</strong></span></a>是将商品管理、在线购物、订单管理、支付管理、文章管理、会员管理、客户咨询反馈、数据统计等功能相结合，并提供了简易的操作、实用的功能，快速让用户建立独立个性化的网上商店，为用户提供了一个低成本、高效率的网上商城建设方案。操作简单好用，会上网者就可以操作。 <br />\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	【安装说明】：\r\n</p>\r\n1.用FTP工具（如flashfxp）把程序上传到服务器；<br />\r\n2.给./data 目录及其子目录 777 权限（windows服务器可忽略此步）；<br />\r\n3.访问http://您的网址/install进行安装。<br />\r\n<br />\r\n【PHPSHE商城系统功能概述】： <br />\r\n软件适用于于各行业产品销售的商家，主要包括有以下功能：<br />\r\n<p>\r\n	（1）管理员发布、修改，删除商品信息，商品多级分类检索、关键词模糊搜索等；\r\n</p>\r\n<p>\r\n	（2）管理员可以对商品规格管理，如：尺寸，颜色，套餐等；\r\n</p>\r\n（3）管理员对商品咨询管理，商品评价管理；<br />\r\n（4）订单流程清晰，可及时便捷查询和修改订单信息；<br />\r\n（5）管理员对文章分类管理、文章管理、单页信息管理；<br />\r\n（6）管理员对会员信息管理，管理帐号管理；<br />\r\n（7）管理员对网站整体基本信息的系统设置；<br />\r\n（8）订单支付方式集成支付宝即时到帐，担保交易，双功能收款，银行转帐/汇款，货到付款等接口方便用户支付；<br />\r\n（9）详细的统计功能，管理员可以实时看到每日订单，网站访客流量情况，提高订单转化率；<br />\r\n（10）数据缓存处理，提高系统的运行效率；<br />\r\n（11）一键对网站进行备份恢复，保障数据安全；<br />\r\n（12）支持友情链接、首页广告图管理；<br />\r\n（13）会员注册、登录，查询历史订单，咨询，评价以及商品收藏等。<br />\r\n<p style=\"margin-top:20px;\">\r\n	<strong>详情请访问：</strong><a href=\"http://www.phpshe.com/phpshe\" title=\"PHPSHE商城系统简介\" target=\"_blank\"><strong><span style=\"color:#E53333;\">PHPSHE商城系统简介</span></strong></a> \r\n</p>','1335856260','840','1'),
('3','请购买正版PHPSHE商城系统','<style>\r\n.taocan td,th{padding:7px 5px; border:1px #ddd solid; color:#555; font-size:12px; line-height:18px;}\r\n.taocan th{ background:#2D89AE; color:#fff; font-weight:normal;}\r\n.taocan .tt1{background:#f3f3f3;}\r\n.taocan .money{color:#cb2529;}\r\n</style>\r\n<div class=\"taocan\">\r\n	<table class=\"ke-zeroborder\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n		<tbody>\r\n			<tr>\r\n				<th colspan=\"2\" style=\"text-align:left;\">\r\n					<strong>商业版说明</strong><br />\r\n				</th>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\" align=\"center\" width=\"200\">\r\n					<strong>系统功能<br />\r\n</strong> \r\n				</td>\r\n				<td align=\"center\">\r\n					无限制\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\" align=\"center\" width=\"200\">\r\n					<strong>商业授权<br />\r\n</strong> \r\n				</td>\r\n				<td align=\"center\">\r\n					终身授权\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\" align=\"center\" width=\"200\">\r\n					<strong>技术支持<br />\r\n</strong> \r\n				</td>\r\n				<td align=\"center\">\r\n					1年\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	<table class=\"mat10 ke-zeroborder\" style=\"text-align:center;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n		<tbody>\r\n			<tr>\r\n				<th colspan=\"2\" style=\"text-align:left;\">\r\n					<strong>技术支持范围</strong> \r\n				</th>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\" width=\"200\">\r\n					<strong>网站数量</strong> \r\n				</td>\r\n				<td>\r\n					1个\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>电话支持</strong> \r\n				</td>\r\n				<td>\r\n					5X8小时\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>Email/QQ支持</strong> \r\n				</td>\r\n				<td>\r\n					<span style=\"color:#E53333;\">√</span> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>在线帮助文档</strong> \r\n				</td>\r\n				<td>\r\n					<span style=\"color:#E53333;\">√</span> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>软件安装指导</strong> \r\n				</td>\r\n				<td>\r\n					<span style=\"color:#E53333;\">√</span> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>软件使用指导</strong> \r\n				</td>\r\n				<td>\r\n					<span style=\"color:#E53333;\">√</span> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>软件升级指导</strong> \r\n				</td>\r\n				<td>\r\n					<span style=\"color:#E53333;\">√</span> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>站点迁移指导</strong> \r\n				</td>\r\n				<td>\r\n					<span style=\"color:#E53333;\">√</span> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>二次开发咨询</strong> \r\n				</td>\r\n				<td>\r\n					<span style=\"color:#E53333;\">√</span> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>版权信息去除</strong> \r\n				</td>\r\n				<td>\r\n					<span style=\"color:#E53333;\">√</span> \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td class=\"tt1\">\r\n					<strong>其他</strong> \r\n				</td>\r\n				<td style=\"text-align:left;\">\r\n					如网站打不开、出现乱码、页面显示不正确、黑客入侵、程序出错等，都会及时给予维护服务，对于软件操作不明白的，也可负责培训。\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	<div class=\"mat10 font12\">\r\n		<p>\r\n			<span class=\"cred\">注意：</span>简好科技未授权任何公司或个人代理销售! 请注意鉴别，以免上当。\r\n		</p>\r\n		<p class=\"mat5\">\r\n			<span class=\"cred\">说明：</span> \r\n		</p>\r\n		<p>\r\n			①商业授权\r\n		</p>\r\n1、企业、政府单位、教育机构、协会团体、厂矿、工作室等所有以营利为目的的用户必须购买软件授权后方可使用。\r\n		<p>\r\n			②以下情况不属于服务范围\r\n		</p>\r\n1、自行修改或使用非原始PHPSHE商城系统程序代码产生的问题；<br />\r\n2、自行对PHPSHE商城系统数据库进行直接操作导致数据库出错或者崩溃；<br />\r\n3、非PHPSHE商城系统官方的模块/插件的安装以及由于安装模块/插件造成的故障；<br />\r\n4、服务器、虚拟主机原因造成的系统故障；<br />\r\n5、二次开发或定制及其它可能产生问题的情况。<br />\r\n	</div>\r\n</div>\r\n<p style=\"margin-top:20px;\">\r\n	<strong>详情请访问：</strong><a href=\"http://www.phpshe.com/phpshe\" title=\"PHPSHE商城系统购买\" target=\"_blank\"><strong><span style=\"color:#E53333;\">PHPSHE商城系统购买</span></strong></a> \r\n</p>','1335863100','921','1');
